import React, { Component }  from 'react';
import { PageHeader, Affix, Button, Card, Carousel, Image } from 'antd';
import './index.less';

const contentStyle = {
  height: '160px',
  color: '#fff',
  lineHeight: '160px',
  textAlign: 'center',
  background: '#fff',
};

class HomePage extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLogin: true,
      isDev: false
    }
  }

  render() {
    const { isLogin, isDev } = this.state;

    return (   
      <div className="home-page">
        <PageHeader
          className="home-page-header"
          backIcon={false}
          title="FA监控平台"
          subTitle="Flight Aware Monitoring Platform"
        />
        <Card
          hoverable
          style={{ width: '75%', marginTop: 20 }}
        >
          <Affix offsetTop={30}>
            <div className="home-page-affix">
              <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20 }} type="primary">
                快速开始
              </Button>
              {
                isLogin && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
                  新建项目
                </Button>
              }
              {
                isLogin && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
                  我的项目
                </Button>
              }
              {
                !isLogin && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
                  用户登陆
                </Button>
              }
              {
                !isLogin && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
                注册账号
              </Button>
              }
              {
                isDev && <Button style={{marginTop: 10,   marginLeft: 20, marginRight: 20}} type="primary">
                内测调试
              </Button>
              }
            </div>
          </Affix>
        </Card>
        <div className="home-page-carousel">
          <Carousel autoplay={true}>
            <div>
              <h3 style={contentStyle}>
                <Image
                  width="100%"
                  height={160}
                  src="https://pic4.zhimg.com/v2-19b7d9ac4953577d809f99b9d8ba8a88_250x0.jpg"
                />
              </h3>
            </div>
            <div>
              <h3 style={contentStyle}>
                <Image
                  width="100%"
                  height={160}
                  src="https://2dhall-pic.ciftis.org/image/20200717/1594990593619071612.jpg?x-oss-process=img/sb/895/285"
                />
              </h3>
            </div>
            <div>
              <h3 style={contentStyle}>
                <Image
                  width="100%"
                  height={160}
                  src="https://image.yunyingpai.com/wp/2020/05/nZEOVErPbJ7VLl9Cnax8.jpg"
                />
              </h3>
            </div>
            <div>
              <h3 style={contentStyle}>
                <Image
                  width="100%"
                  height={160}
                  src="https://2dhall-pic.ciftis.org/image/20200717/1594990606064033492.jpg?x-oss-process=img/sb/895/285"
                />
              </h3>
            </div>
          </Carousel>
        </div>
        <Card
          hoverable
          style={{ width: '75%', marginTop: 20, height: 2000 }}
        >
        </Card>
      </div>
    );
  }
}

export default HomePage;
